    public static List<Integer> findSubstring(String s, String[] words) {
        if(s.length()==1 && words.length==1 && s.equals(words[0]))
            return Arrays.asList(new Integer[]{0});
        List<Integer> output=new ArrayList<>();
          //word,frequency
        Map<String,Integer> map=new HashMap<>();
        int wordLen=words[0].length();
        int wordCount=words.length;
        for(int i=0;i<words.length;i++){
           map.put(words[i] ,map.get(words[i])==null?1:map.get(words[i])+1);
        }
        for(int i=0 ;i<s.length() ;i++){
            if(i+wordLen<s.length() && map.keySet().contains(s.substring(i,i+wordLen))){
                int j=i;
                   //word,frequency
                Map<String,Integer> seen=new HashMap<>();
                while(j+wordLen<=s.length()){
                    String subString=s.substring(j,j+wordLen);
                    if(map.keySet().contains(subString)){
                        Integer frequency=seen.get(subString);
                        Integer availableFrequency=map.get(subString);
                        frequency=frequency==null?1:frequency+1;
                        if(frequency<=availableFrequency){
                            seen.put(subString, frequency);
                        }else{
                            break;
                        }
                    }else{
                        break;
                    }
                    j=j+wordLen;
                }
                boolean flag=false;
                int counter=0;
                for(String key: map.keySet()){
                    if(map.get(key).equals(seen.get(key))){
                        flag=true;
                        counter++;
                    }
                }
                if(flag && counter==map.size())
                    output.add(i);
            }
        }
        return output;
    }
